import React from "react";
import "./our-member.css";
import { Link } from "react-router-dom";
import ava01 from "./cars-img/bmw-offer.png";
import ava02 from "./cars-img/mercedes-offer.png";
import ava03 from "./cars-img/nissan-offer.png";
import img from "./cars-img/nissan-offer.png";
import carData from "./carData";



import Back from "../common/Back";

const OUR__MEMBERS = [
  {
    name: "Jhon Doe",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava01,
  },

  {
    name: "David Lisa",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava02,
  },

  {
    name: "Hilton King",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava03,
  },

  {
    name: "Jhon Doe",
    experience: "5 years of experience",
    fbUrl: "#",
    instUrl: "#",
    twitUrl: "#",
    linkedinUrl: "#",
    imgUrl: ava01,
  },
];

const Cars = () => {
  return (
    <section>
    <Back name='About Us' title='About Us - Who We Are?' cover={img} />
    <div className='content grid3 mtop'>
      {carData.map((item, index) => (
        <div  key={index} className="box shadow cars">
          <div className="single__member">
            <div className="single__member-img img">
              <img src={item.imgUrl} alt=""  />
            </div>
            <div className="name">
              <h1>{item.carName}/{item.model}</h1>
              <p>{item.price}</p>
            </div>


            <h6 className="text-center mb-0 mt-3">{item.name}</h6>
            <p className="section__description text-center">
              {item.experience}
            </p>
          </div>
        </div>
      ))}
    </div>
    </section>
  );
};

export default Cars;
